INSERT INTO `notification_template` VALUES (1,'EmailVerification','Please verify your email','<p>Dear %FIRSTNAME%,</p>\n      <p>You recently created an account at %URL% on %CREATED_AT%. Please verify your email to continue with your account. Please use the following token to verify your email:</p>\n      <p>%TOKEN%</p>\n      <p>Alternatively, you can click the following link to verify your email:</p>\n      <p>%URL%/login?token=%TOKEN%</p>\n      <p>If you did not create an account, please disregard this email.</p>',NULL,NULL,'[\"FIRSTNAME\",\"CREATED_AT\",\"TOKEN\"]',1,0,0),(2,'PasswordReset','Password Reset Request','<p>Dear %FIRSTNAME%,</p><p>You requested to reset your password. Please follow the link below. If you did not request to reset your password, disregard this email. Your last login time was: %LAST_LOGIN%.</p><p>This is a one-time password link that will reveal a temporary password.</p><p>Password reset link: %URL%/reset?token=%TOKEN%</p>',NULL,NULL,'[\"FIRSTNAME\",\"LAST_LOGIN\",\"TOKEN\"]',1,0,0),(3,'EmailTest','Email System Test','<p>Dear %FIRSTNAME%,</p><p>Your email system at %URL% is working as expected. This test email was sent on %TIME%.</p><p>If you did not expect this email, please contact support.</p>',NULL,NULL,'[\"FIRSTNAME\",\"TIME\"]',1,0,0),(4,'KycSubmission','KYC Submission Confirmation','<p>Dear %FIRSTNAME%,</p><p>Thank you for submitting your KYC application on %CREATED_AT%. Your application is now under review.</p><p>Level: %LEVEL%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"CREATED_AT\",\"LEVEL\",\"STATUS\"]',1,0,0),(5,'KycUpdate','KYC Update Confirmation','<p>Dear %FIRSTNAME%,</p><p>Your KYC application has been updated on %UPDATED_AT%. It is now under review again.</p><p>Updated Level: %LEVEL%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"UPDATED_AT\",\"LEVEL\",\"STATUS\"]',1,0,0),(6,'KycApproved','Your KYC Application has been Approved','<p>Dear %FIRSTNAME%,</p><p>Your KYC application submitted on %UPDATED_AT% has been approved.</p><p>Your current level is: %LEVEL%</p><p>Thank you for your cooperation.</p><p>Best regards,</p><p> YourSupport Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"UPDATED_AT\",\"LEVEL\"]',1,0,0),(7,'KycRejected','Your KYC Application has been Rejected','<p>Dear %FIRSTNAME%,</p><p>Unfortunately, your KYC application submitted on %UPDATED_AT% has been rejected.</p><p>Reason: %MESSAGE%</p><p>Please contact our support team for more information.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"UPDATED_AT\",\"MESSAGE\",\"LEVEL\"]',1,0,0),(8,'NewInvestmentCreated','New Investment Created','<p>Dear %FIRSTNAME%,</p><p>You have successfully created a new investment in the %PLAN_NAME% plan.</p><p>Amount Invested: %AMOUNT%</p><p>Duration: %DURATION% %TIMEFRAME%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"DURATION\",\"TIMEFRAME\",\"STATUS\"]',1,0,0),(9,'InvestmentUpdated','Investment Updated','<p>Dear %FIRSTNAME%,</p><p>Your investment in the %PLAN_NAME% plan has been updated.</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(10,'InvestmentCanceled','Investment Canceled','<p>Dear %FIRSTNAME%,</p><p>Your investment in the %PLAN_NAME% plan has been canceled.</p><p>Amount Returned: %AMOUNT% %CURRENCY%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(11,'UserMessage','New Message From Support','<p>Dear %RECEIVER_NAME%,</p><p>You have a new message from our support team regarding ticket ID: %TICKET_ID%.</p><p>Message:</p><p>%MESSAGE%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"RECEIVER_NAME\",\"TICKET_ID\",\"MESSAGE\"]',1,0,0),(12,'SupportMessage','New User Message','<p>Dear %RECEIVER_NAME%,</p><p>You have a new message from %SENDER_NAME% regarding ticket ID: %TICKET_ID%.</p><p>Message:</p><p>%MESSAGE%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"RECEIVER_NAME\",\"SENDER_NAME\",\"TICKET_ID\",\"MESSAGE\"]',1,0,0),(13,'FiatWalletTransaction','Transaction Alert: %TRANSACTION_TYPE%','<p>Dear %FIRSTNAME%,</p><p>You have recently made a %TRANSACTION_TYPE% transaction.</p><p>Details:</p><ul><li>Transaction ID: %TRANSACTION_ID%</li><li>Amount: %AMOUNT% %CURRENCY%</li><li>Status: %TRANSACTION_STATUS%</li><li>Current Wallet Balance: %NEW_BALANCE% %CURRENCY%</li><li>Description: %DESCRIPTION%</li></ul><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TRANSACTION_TYPE\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\",\"TRANSACTION_STATUS\",\"NEW_BALANCE\",\"DESCRIPTION\"]',1,0,0),(14,'BinaryOrderResult','Binary Order Result: %RESULT%','<p>Dear %FIRSTNAME%,</p><p>Here is the outcome of your recent binary order (ID: %ORDER_ID%).</p><p><strong>Order Details:</strong></p><ul>  <li><strong>Market:</strong> %MARKET%</li>  <li><strong>Amount:</strong> %AMOUNT% %CURRENCY%</li>  <li><strong>Entry Price:</strong> %ENTRY_PRICE%</li>  <li><strong>Closed at Price:</strong> %CLOSE_PRICE%</li></ul><p><strong>Order Outcome:</strong></p><ul>  <li><strong>Result:</strong> %RESULT%</li>  <li><strong>Profit/Loss:</strong> %PROFIT% %CURRENCY%</li>  <li><strong>Side:</strong> %SIDE%</li></ul><p>Thank you for using our platform.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"ORDER_ID\",\"RESULT\",\"MARKET\",\"AMOUNT\",\"PROFIT\",\"SIDE\",\"CURRENCY\",\"ENTRY_PRICE\",\"CLOSE_PRICE\"]',1,0,0),(15,'WalletBalanceUpdate','Wallet Balance Update','<p>Hello %FIRSTNAME%,</p><p>Your wallet balance has been %ACTION% by an admin.</p><p>Details:</p><ul><li>Action: %ACTION%</li><li>Amount: %AMOUNT% %CURRENCY%</li><li>New Balance: %NEW_BALANCE% %CURRENCY%</li></ul><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"ACTION\",\"AMOUNT\",\"CURRENCY\",\"NEW_BALANCE\"]',1,0,0),(16,'TransactionStatusUpdate','Transaction Status Update: %TRANSACTION_TYPE%','<p>Hello %FIRSTNAME%,</p><p>Your transaction of type %TRANSACTION_TYPE% has been updated.</p><p>Details:</p><ul><li>Transaction ID: %TRANSACTION_ID%</li><li>Status: %TRANSACTION_STATUS%</li><li>Amount: %AMOUNT% %CURRENCY%</li><li>Updated Balance: %NEW_BALANCE% %CURRENCY%</li><li>Note: %NOTE%</li></ul><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TRANSACTION_TYPE\",\"TRANSACTION_ID\",\"TRANSACTION_STATUS\",\"AMOUNT\",\"CURRENCY\",\"NEW_BALANCE\",\"NOTE\"]',1,0,0),(17,'AuthorStatusUpdate','Author Application Status: %AUTHOR_STATUS%','<p>Hello %FIRSTNAME%,</p><p>Your application to join our Authorship Program has been %AUTHOR_STATUS%.</p><p>Details:</p><ul><li>Application ID: %APPLICATION_ID%</li><li>Status: %AUTHOR_STATUS%</li></ul><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"AUTHOR_STATUS\",\"APPLICATION_ID\"]',1,0,0),(18,'OutgoingWalletTransfer','Outgoing Wallet Transfer Confirmation','<p>Hello %FIRSTNAME%,</p><p>You have successfully transferred %AMOUNT% %CURRENCY% to %RECIPIENT_NAME%.</p><p>Your new balance: %NEW_BALANCE% %CURRENCY%</p><p>Transaction ID: %TRANSACTION_ID%</p>',NULL,NULL,'[\"FIRSTNAME\",\"AMOUNT\",\"CURRENCY\",\"NEW_BALANCE\",\"TRANSACTION_ID\",\"RECIPIENT_NAME\"]',1,0,0),(19,'IncomingWalletTransfer','Incoming Wallet Transfer Confirmation','<p>Hello %FIRSTNAME%,</p><p>You have received %AMOUNT% %CURRENCY% from %SENDER_NAME%.</p><p>Your new balance: %NEW_BALANCE% %CURRENCY%</p><p>Transaction ID: %TRANSACTION_ID%</p>',NULL,NULL,'[\"FIRSTNAME\",\"AMOUNT\",\"CURRENCY\",\"NEW_BALANCE\",\"TRANSACTION_ID\",\"SENDER_NAME\"]',1,0,0),(20,'SpotWalletWithdrawalConfirmation','Spot Wallet Withdrawal','<p>Dear %FIRSTNAME%,</p><p>You have successfully initiated a withdrawal from your Spot Wallet.</p><p>Details:</p><ul><li>Amount: %AMOUNT% %CURRENCY%</li><li>Address: %ADDRESS%</li><li>Transaction Fee: %FEE%</li><li>Network Chain: %CHAIN%</li><li>Memo: %MEMO%</li><li>Status: %STATUS%</li></ul><p>If you did not make this request, please contact our support immediately.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"AMOUNT\",\"CURRENCY\",\"ADDRESS\",\"FEE\",\"CHAIN\",\"MEMO\",\"STATUS\"]',1,0,0),(21,'SpotWalletDepositConfirmation','Spot Wallet Deposit','<p>Dear %FIRSTNAME%,</p><p>Your spot wallet deposit has been successfully processed.</p><p>Details:</p><ul><li>Transaction ID: %TRANSACTION_ID%</li><li>Amount: %AMOUNT% %CURRENCY%</li><li>Network Chain: %CHAIN%</li><li>Transaction Fee: %FEE%</li><li>Status: COMPLETED</li></ul><p>If you did not make this deposit, please contact our support immediately.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\",\"CHAIN\",\"FEE\"]',1,0,0),(22,'NewAiInvestmentCreated','New AI Investment Initiated','<p>Dear %FIRSTNAME%,</p><p>You have successfully created a new AI investment in the %PLAN_NAME% plan.</p><p>Amount Invested: %AMOUNT% %CURRENCY%</p><p>Duration: %DURATION% %TIMEFRAME%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"CURRENCY\",\"DURATION\",\"TIMEFRAME\",\"STATUS\"]',1,0,0),(23,'AiInvestmentCompleted','AI Investment Completed','<p>Dear %FIRSTNAME%,</p><p>Your AI investment in the %PLAN_NAME% plan has been completed.</p><p>Invested Amount: %AMOUNT% %CURRENCY%</p><p>Result: %PROFIT% %CURRENCY%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"PROFIT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(24,'AiInvestmentCanceled','AI Investment Canceled','<p>Dear %FIRSTNAME%,</p><p>Your AI investment in the %PLAN_NAME% plan has been canceled.</p><p>Amount Refunded: %AMOUNT% %CURRENCY%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(25,'WithdrawalStatus','Withdrawal Status: %STATUS%','<p>Dear %FIRSTNAME%,</p><p>Your withdrawal request has been %STATUS%.</p><p>If the withdrawal is canceled, the reason is: %REASON%.</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"STATUS\",\"REASON\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\"]',1,0,0),(26,'DepositConfirmation','Deposit Confirmation','<p>Dear %FIRSTNAME%,</p><p>Your deposit has been successfully confirmed.</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\"]',1,0,0),(27,'TransferConfirmation','Transfer Confirmation','<p>Dear %FIRSTNAME%,</p><p>Your transfer has been successfully completed.</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>To: %RECIPIENT_NAME%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\",\"RECIPIENT_NAME\"]',1,0,0),(28,'NewForexInvestmentCreated','New Forex Investment Initiated','<p>Dear %FIRSTNAME%,</p><p>You have successfully created a new Forex investment in the %PLAN_NAME% plan.</p><p>Amount Invested: %AMOUNT%</p><p>Duration: %DURATION% %TIMEFRAME%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"DURATION\",\"TIMEFRAME\",\"STATUS\"]',1,0,0),(29,'ForexInvestmentCompleted','Forex Investment Completed','<p>Dear %FIRSTNAME%,</p><p>Your Forex investment in the %PLAN_NAME% plan has been completed.</p><p>Invested Amount: %AMOUNT%</p><p>Result: %PROFIT%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"PROFIT\",\"STATUS\"]',1,0,0),(30,'ForexInvestmentCanceled','Forex Investment Canceled','<p>Dear %FIRSTNAME%,</p><p>Your Forex investment in the %PLAN_NAME% plan has been canceled.</p><p>Amount Refunded: %AMOUNT%</p><p>Status: %STATUS%</p>',NULL,NULL,'[\"FIRSTNAME\",\"PLAN_NAME\",\"AMOUNT\",\"STATUS\"]',1,0,0),(31,'ForexDepositConfirmation','Forex Deposit Confirmation','<p>Dear %FIRSTNAME%,</p><p>You have successfully deposited into your Forex account.</p><p>Account ID: %ACCOUNT_ID%</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>Status: %STATUS%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"ACCOUNT_ID\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(32,'ForexWithdrawalConfirmation','Forex Withdrawal Confirmation','<p>Dear %FIRSTNAME%,</p><p>You have successfully withdrawn from your Forex account.</p><p>Account ID: %ACCOUNT_ID%</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Amount: %AMOUNT% %CURRENCY%</p><p>Status: %STATUS%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"ACCOUNT_ID\",\"TRANSACTION_ID\",\"AMOUNT\",\"CURRENCY\",\"STATUS\"]',1,0,0),(33,'IcoNewContribution','Confirmation of Your ICO Contribution','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>Thank you for your contribution to the %TOKEN_NAME% ICO.</p>\n      <p>Details of your contribution:</p>\n      <ul>\n        <li>Token: %TOKEN_NAME%</li>\n        <li>Phase: %PHASE_NAME%</li>\n        <li>Amount: %AMOUNT% %CURRENCY%</li>\n        <li>Contribution Status: %CONTRIBUTION_STATUS%</li>\n        <li>Date: %DATE%</li>\n      </ul>\n      <p>If you have any questions, please feel free to reach out to us.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN_NAME\",\"PHASE_NAME\",\"AMOUNT\",\"CURRENCY\",\"CONTRIBUTION_STATUS\",\"DATE\"]',1,0,0),(34,'IcoContributionPaid','Your ICO Contribution Tokens Have Been Dispatched','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>We are pleased to inform you that the tokens for your contribution to the %TOKEN_NAME% ICO have been dispatched.</p>\n      <p>Details of your transaction:</p>\n      <ul>\n        <li>Token: %TOKEN_NAME%</li>\n        <li>Phase: %PHASE_NAME%</li>\n        <li>Amount: %AMOUNT% %CURRENCY%</li>\n        <li>Transaction ID: %TRANSACTION_ID%</li>\n        <li>Date: %DATE%</li>\n      </ul>\n      <p>Please check your wallet to confirm the receipt of your tokens.</p>\n      <p>If you have any questions or did not receive your tokens, please contact support immediately.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN_NAME\",\"PHASE_NAME\",\"AMOUNT\",\"CURRENCY\",\"TRANSACTION_ID\",\"DATE\"]',1,0,0),(35,'StakingInitiationConfirmation','Confirmation of Your Staking Initiation','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>Your staking has been successfully initiated.</p>\n      <p>Details of your stake:</p>\n      <ul>\n        <li>Token: %TOKEN_NAME%</li>\n        <li>Amount: %STAKE_AMOUNT% %TOKEN_SYMBOL%</li>\n        <li>Stake Date: %STAKE_DATE%</li>\n        <li>Release Date: %RELEASE_DATE%</li>\n        <li>Expected Reward: %EXPECTED_REWARD% %TOKEN_SYMBOL%</li>\n      </ul>\n      <p>Your funds are now earning rewards!</p>\n      <p>If you have any questions, please feel free to reach out to us.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN_NAME\",\"STAKE_AMOUNT\",\"TOKEN_SYMBOL\",\"STAKE_DATE\",\"RELEASE_DATE\",\"EXPECTED_REWARD\"]',1,0,0),(36,'StakingRewardDistribution','Your Staking Rewards Have Been Distributed','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>We are pleased to inform you that rewards for your staking have been distributed to your account.</p>\n      <p>Details of the reward distribution:</p>\n      <ul>\n        <li>Token: %TOKEN_NAME%</li>\n        <li>Reward Amount: %REWARD_AMOUNT% %TOKEN_SYMBOL%</li>\n        <li>Distribution Date: %DISTRIBUTION_DATE%</li>\n      </ul>\n      <p>Thank you for staking with us, and enjoy your earnings!</p>\n      <p>If you have any questions or concerns about your rewards, please contact support.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN_NAME\",\"REWARD_AMOUNT\",\"TOKEN_SYMBOL\",\"DISTRIBUTION_DATE\"]',1,0,0),(37,'OrderConfirmation','Thank You for Your Order!','\n      <p>Dear %CUSTOMER_NAME%,</p>\n      <p>Thank you for shopping with us. Your order has been successfully placed.</p>\n      <p>Order Details:</p>\n      <ul>\n        <li>Order Number: %ORDER_NUMBER%</li>\n        <li>Order Date: %ORDER_DATE%</li>\n        <li>Total Amount: %ORDER_TOTAL%</li>\n      </ul>\n      <p>You can track your order status in your account.</p>\n      <p>If you have any questions, please contact our customer service team.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"CUSTOMER_NAME\",\"ORDER_NUMBER\",\"ORDER_DATE\",\"ORDER_TOTAL\"]',1,0,0),(38,'OrderStatusUpdate','Update on Your Order - Action Required','\n      <p>Dear %CUSTOMER_NAME%,</p>\n      <p>Your recent order with us (Order No: %ORDER_NUMBER%) has been updated to %ORDER_STATUS%.</p>\n      <p>Please find below the details of your purchase:</p>\n      <ul>\n        %PRODUCT_DETAILS%\n      </ul>\n      <p>If your order status is \'COMPLETED\', your product keys (if applicable) are available and can be accessed through your account or the provided links.</p>\n      <p>If you have any questions or require further assistance, please do not hesitate to contact our support team.</p>\n      <p>Thank you for choosing our services!</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"CUSTOMER_NAME\",\"ORDER_NUMBER\",\"ORDER_STATUS\",\"PRODUCT_DETAILS\"]',1,0,0),(39,'P2PTradeSaleConfirmation','Confirmation of Your P2P Trade Sale','<p>Dear %SELLER_NAME%,</p><p>A trade has been initiated on your offer for %CURRENCY%.</p><p>Trade Details:</p><ul><li>Buyer: %BUYER_NAME%</li><li>Amount: %AMOUNT% %CURRENCY%</li><li>Price: %PRICE%</li><li>Trade ID: %TRADE_ID%</li></ul><p>Please respond to the buyer to proceed with the trade.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"SELLER_NAME\",\"BUYER_NAME\",\"CURRENCY\",\"AMOUNT\",\"PRICE\",\"TRADE_ID\"]',1,0,0),(40,'P2PTradeReply','New Message in Your P2P Trade','<p>Dear %RECEIVER_NAME%,</p><p>You have a new message in your P2P trade with %SENDER_NAME%.</p><p>Trade ID: %TRADE_ID%</p><p>Message:</p><p>%MESSAGE%</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"RECEIVER_NAME\",\"SENDER_NAME\",\"TRADE_ID\",\"MESSAGE\"]',1,0,0),(41,'P2PDisputeOpened','Dispute Opened for Your P2P Trade','<p>Dear %PARTICIPANT_NAME%,</p><p>A dispute has been opened for your trade with %OTHER_PARTY_NAME%.</p><p>Trade ID: %TRADE_ID%</p><p>Dispute Reason:</p><p>%DISPUTE_REASON%</p><p>Our support team will review the dispute and contact you shortly.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"PARTICIPANT_NAME\",\"OTHER_PARTY_NAME\",\"TRADE_ID\",\"DISPUTE_REASON\"]',1,0,0),(42,'P2PDisputeResolution','Dispute Resolution Update for Your P2P Trade','<p>Dear %PARTICIPANT_NAME%,</p><p>The dispute for your trade ID: %TRADE_ID% has a new resolution update.</p><p>Resolution Message:</p><p>%RESOLUTION_MESSAGE%</p><p>Please review the resolution and follow any necessary steps.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"PARTICIPANT_NAME\",\"TRADE_ID\",\"RESOLUTION_MESSAGE\"]',1,0,0),(43,'P2PDisputeResolving','Your P2P Trade Dispute is Being Resolved','<p>Dear %PARTICIPANT_NAME%,</p><p>Your trade dispute for Trade ID: %TRADE_ID% is in the process of being resolved.</p><p>Our team is working diligently to resolve the issue. We appreciate your patience.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"PARTICIPANT_NAME\",\"TRADE_ID\"]',1,0,0),(44,'P2PDisputeClosing','Closure of Your P2P Trade Dispute','<p>Dear %PARTICIPANT_NAME%,</p><p>The dispute for your trade ID: %TRADE_ID% has been closed.</p><p>We hope the resolution was satisfactory. If you have any further questions, please contact our support team.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"PARTICIPANT_NAME\",\"TRADE_ID\"]',1,0,0),(45,'P2PTradeCompletion','Confirmation of Completed P2P Trade','<p>Dear %SELLER_NAME%,</p><p>Your trade with %BUYER_NAME% for %AMOUNT% %CURRENCY% has been completed successfully.</p><p>Trade ID: %TRADE_ID%</p><p>Thank you for using our P2P platform.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"SELLER_NAME\",\"BUYER_NAME\",\"AMOUNT\",\"CURRENCY\",\"TRADE_ID\"]',1,0,0),(46,'P2PTradeCancellation','Cancellation of Your P2P Trade','<p>Dear %PARTICIPANT_NAME%,</p><p>Your trade ID: %TRADE_ID% has been cancelled.</p><p>If you have any questions or concerns, please contact our support team.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"PARTICIPANT_NAME\",\"TRADE_ID\"]',1,0,0),(47,'P2PTradePaymentConfirmation','Payment Confirmation for Your P2P Trade','<p>Dear %SELLER_NAME%,</p><p>%BUYER_NAME% has marked the trade ID: %TRADE_ID% as paid.</p><p>Transaction ID: %TRANSACTION_ID%</p><p>Please confirm the payment on your end to complete the trade.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"SELLER_NAME\",\"BUYER_NAME\",\"TRADE_ID\",\"TRANSACTION_ID\"]',1,0,0),(48,'P2PReviewNotification','New Review for Your P2P Offer','<p>Dear %SELLER_NAME%,</p><p>You have received a new review for your offer ID: %OFFER_ID%.</p><p>Reviewer: %REVIEWER_NAME%</p><p>Rating: %RATING%</p><p>Comment: %COMMENT%</p><p>Thank you for providing a quality service on our platform.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"SELLER_NAME\",\"OFFER_ID\",\"REVIEWER_NAME\",\"RATING\",\"COMMENT\"]',1,0,0),(49,'P2POfferAmountDepletion','Notification of Offer Amount Depletion','<p>Dear %SELLER_NAME%,</p><p>The available amount for your offer ID: %OFFER_ID% is running low.</p><p>Current Amount: %CURRENT_AMOUNT% %CURRENCY%</p><p>Consider updating your offer to continue trading.</p><p>Best regards,</p><p>Your Support Team</p>',NULL,NULL,'[\"SELLER_NAME\",\"OFFER_ID\",\"CURRENT_AMOUNT\",\"CURRENCY\"]',1,0,0),(50,'OTPTokenVerification','Your OTP Token for Login','<p>Dear %FIRSTNAME%,</p>\n      <p>Your OTP token for login is: %TOKEN%</p>\n      <p>You can use this token to login to your account in the future. Please keep it secure.</p>\n      <p>If you did not request this token, please disregard this email.</p>',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN\"]',1,0,0),(51,'LiquidationWarning','Warning: Position at Risk of Liquidation','<p>Dear %FIRSTNAME%,</p>\n      <p>Your position in %SYMBOL% is at risk of liquidation.</p>\n      <p>Current Margin: %MARGIN%</p>\n      <p>Leverage: %LEVERAGE%</p>\n      <p>Entry Price: %ENTRY_PRICE%</p>\n      <p>Current Price: %CURRENT_PRICE%</p>\n      <p>Please take action to manage your position.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"SYMBOL\",\"MARGIN\",\"LEVERAGE\",\"ENTRY_PRICE\",\"CURRENT_PRICE\"]',1,0,0),(52,'LiquidationNotification','Notification: Position Liquidated','<p>Dear %FIRSTNAME%,</p>\n      <p>Your position in %SYMBOL% has been liquidated.</p>\n      <p>Leverage: %LEVERAGE%</p>\n      <p>Entry Price: %ENTRY_PRICE%</p>\n      <p>Current Price: %CURRENT_PRICE%</p>\n      <p>We encourage you to review your trading strategy and consider adjustments to manage your risk.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"SYMBOL\",\"LEVERAGE\",\"ENTRY_PRICE\",\"CURRENT_PRICE\"]',1,0,0),(53,'PartialLiquidationNotification','Notification: Partial Position Liquidation','<p>Dear %FIRSTNAME%,</p>\n      <p>Your position in %SYMBOL% has been partially liquidated.</p>\n      <p>Leverage: %LEVERAGE%</p>\n      <p>Entry Price: %ENTRY_PRICE%</p>\n      <p>Current Price: %CURRENT_PRICE%</p>\n      <p>Please review your remaining position and take any necessary actions to manage your risk.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"SYMBOL\",\"LEVERAGE\",\"ENTRY_PRICE\",\"CURRENT_PRICE\"]',1,0,0),(54,'AccountDeletionConfirmation','Confirm Account Deletion','<p>Dear %FIRSTNAME%,</p>\n      <p>We have received a request to delete your account.</p>\n      <p>If you did not make this request, please disregard this email.</p>\n      <p>Otherwise, use the code below to confirm the deletion of your account:</p>\n      <p><strong>%TOKEN%</strong></p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\",\"TOKEN\"]',1,0,0),(55,'AccountDeletionConfirmed','Account Deleted Successfully','<p>Dear %FIRSTNAME%,</p>\n      <p>Your account has been successfully deleted.</p>\n      <p>We are sorry to see you go.</p>\n      <p>If this was a mistake, please contact our support team.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>',NULL,NULL,'[\"FIRSTNAME\"]',1,0,0),(56,'EcoWithdrawalConfirmation','Your Withdrawal is Successful','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>Your withdrawal of %AMOUNT% %CURRENCY% to address %TO_ADDRESS% has been successfully processed.</p>\n      <p>Transaction ID: %TRANSACTION_ID%</p>\n      <p>Network Chain: %CHAIN%</p>\n      <p>Thank you for using our services.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"AMOUNT\",\"CURRENCY\",\"TO_ADDRESS\",\"TRANSACTION_ID\",\"CHAIN\"]',1,0,0),(57,'EcoWithdrawalFailed','Your Withdrawal Failed','\n      <p>Dear %FIRSTNAME%,</p>\n      <p>We regret to inform you that your withdrawal of %AMOUNT% %CURRENCY% to address %TO_ADDRESS% has failed.</p>\n      <p>Reason: %REASON%</p>\n      <p>The withdrawn amount has been returned to your account.</p>\n      <p>If you have any questions, please contact our support team.</p>\n      <p>Best regards,</p>\n      <p>Your Support Team</p>\n    ',NULL,NULL,'[\"FIRSTNAME\",\"AMOUNT\",\"CURRENCY\",\"TO_ADDRESS\",\"REASON\"]',1,0,0);
